import React, { Component } from 'react';

import { Container, Row, Col } from 'react-bootstrap-grid-component';

class Metrics extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col md={3}>
            <h4>Visits</h4>
          </Col>
          <Col md={9}>
            <h4>Metrics</h4>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Metrics;
